import React from "react";
import { BrowserRouter, Route } from "react-router-dom"; 

import StreamCreate from "./streams";

const App = () => {
    return (
      <div className="ui">
        <BrowserRouter>
          <div>
            <Route path="/streamCreate" component={StreamCreate} />
          </div>
        </BrowserRouter>
      </div>
    );
}

export default App;
